import React from 'react';

import { signInWithGooglePopup, creatUserDocumentFromAuth, signInWithGoogleRedirect } from '../../utils/firebase/firebase.utils';

function SignIn() {
    const logGoogleUserPopup = async () => {
        const { user } = await signInWithGooglePopup();
        const userDocRef = await creatUserDocumentFromAuth(user)
    }
    const logGoogleUserRedirect = async () => {
        const { user } = await signInWithGoogleRedirect();
        console.log({ user })
    }
    return (
        <>
            <button onClick={logGoogleUserPopup}>sign-in</button>
            <button onClick={logGoogleUserRedirect}>sign-in redirect</button>
        </>
    )
}

export default SignIn
